import { useState } from 'react';

function DataUploadPage() {
  const [manualEntries, setManualEntries] = useState([]);
  const [csvData, setCsvData] = useState(null);

  const handleAddManualEntry = () => {
    setManualEntries([
      ...manualEntries,
      {
        id: Date.now(),
        stationName: '',
        latitude: '',
        longitude: '',
        precipitation: '',
      },
    ]);
  };

  const handleManualEntryChange = (id, field, value) => {
    setManualEntries(
      manualEntries.map((entry) =>
        entry.id === id ? { ...entry, [field]: value } : entry
      )
    );
  };

  const handleCsvUpload = (event) => {
    const file = event.target.files[0];
    if (file) {
      const reader = new FileReader();
      reader.onload = (e) => {
        const text = e.target.result;
        // Process CSV data here
        setCsvData(text);
      };
      reader.readAsText(file);
    }
  };

  const handleSaveData = () => {
    // Save to localStorage
    const data = {
      manualEntries,
      csvData,
      timestamp: new Date().toISOString(),
    };
    localStorage.setItem('precipitationData', JSON.stringify(data));
    alert('Data saved successfully!');
  };

  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-4xl font-bold mb-6">Data Upload</h1>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-2xl font-semibold mb-4">Manual Entry</h2>
          <div className="space-y-4">
            {manualEntries.map((entry) => (
              <div key={entry.id} className="grid grid-cols-2 gap-4">
                <input
                  type="text"
                  placeholder="Station Name"
                  className="p-2 border rounded"
                  value={entry.stationName}
                  onChange={(e) =>
                    handleManualEntryChange(entry.id, 'stationName', e.target.value)
                  }
                />
                <input
                  type="number"
                  placeholder="Latitude"
                  className="p-2 border rounded"
                  value={entry.latitude}
                  onChange={(e) =>
                    handleManualEntryChange(entry.id, 'latitude', e.target.value)
                  }
                />
                <input
                  type="number"
                  placeholder="Longitude"
                  className="p-2 border rounded"
                  value={entry.longitude}
                  onChange={(e) =>
                    handleManualEntryChange(entry.id, 'longitude', e.target.value)
                  }
                />
                <input
                  type="number"
                  placeholder="Precipitation (mm)"
                  className="p-2 border rounded"
                  value={entry.precipitation}
                  onChange={(e) =>
                    handleManualEntryChange(entry.id, 'precipitation', e.target.value)
                  }
                />
              </div>
            ))}
            <button
              onClick={handleAddManualEntry}
              className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600"
            >
              Add Station
            </button>
          </div>
        </div>

        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-2xl font-semibold mb-4">CSV Upload</h2>
          <div className="space-y-4">
            <input
              type="file"
              accept=".csv"
              onChange={handleCsvUpload}
              className="block w-full text-sm text-gray-500 file:mr-4 file:py-2 file:px-4 file:rounded-full file:border-0 file:text-sm file:font-semibold file:bg-blue-50 file:text-blue-700 hover:file:bg-blue-100"
            />
            {csvData && (
              <div className="mt-4">
                <h3 className="font-semibold">Preview:</h3>
                <pre className="mt-2 p-4 bg-gray-50 rounded overflow-x-auto">
                  {csvData.slice(0, 200)}...
                </pre>
              </div>
            )}
          </div>
        </div>
      </div>

      <div className="mt-6">
        <button
          onClick={handleSaveData}
          className="bg-green-500 text-white px-6 py-2 rounded hover:bg-green-600"
        >
          Save Data
        </button>
      </div>
    </div>
  );
}

export default DataUploadPage;
